mapper.select:

select 

from jvd_hanro_chokyo
where CHOKYO_JIKOKU = #{chokyoJikoku,jdbcType=TIMESTAMP}
  and KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and TRACEN_KUBUN = #{tracenKubun,jdbcType=CHAR}

mapper.delete:

delete from jvd_hanro_chokyo
where CHOKYO_JIKOKU = #{chokyoJikoku,jdbcType=TIMESTAMP}
  and KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and TRACEN_KUBUN = #{tracenKubun,jdbcType=CHAR}
